USE jac;

CREATE TABLE Fee_Codes (
    Fee_Idx INT PRIMARY KEY,
    Head VARCHAR(20) NOT NULL,
    Branch VARCHAR(3) NOT NULL,
    Subjects VARCHAR(100) NOT NULL,
    Fee_Type VARCHAR(2) NOT NULL,
    Dsp_Seq INT NOT NULL,
    Use_Flag INT NOT NULL,
    Grade_Code INT NOT NULL,
    Season INT NOT NULL,
    Invoice_Flag INT NOT NULL,
    Fee_Abb VARCHAR(10) NOT NULL,
    Fee_Name VARCHAR(50) NOT NULL,
    Price DECIMAL(8,2) NOT NULL,
    reference BIGINT NULL
);

